def Reverse_Complement(pattern):
    complement = {'A':'T', 'T': 'A', 'G': 'C', 'C': 'G'}
    ans = []
    for i in range(len(pattern)):
        ans.append(complement[pattern[i]])
    ans.reverse()
#     print(ans)
    return ''.join(ans)
        


pattern = 'AAAACCCGGT'
# pattern = ''
print(Reverse_Complement(pattern))
